const Footer = () => {
    return (
        <footer style={{ padding: "10px", backgroundColor: "#f1f1f1", textAlign: "center" }}>
            <p>&copy; 2024 CollegeRankings. All Rights Reserved.</p>
        </footer>
    );
};

export default Footer;
